import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Card from 'react-bootstrap/Card';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import NavDropdown from 'react-bootstrap/NavDropdown';
// import React, { Component } from 'react';
import { useState,useEffect } from 'react';
import axios from 'axios';

function Navigation() {
    const myStyle = {
      backgroundImage: `url(/back.jpg)`,
      backgroundSize: 'cover',
      backgroundRepeat: 'no-repeat',}

      const [ethPrice,setEthprice] = useState('');

    useEffect(() => {
      async function getBlockNumber() {

        const response = await axios.get(
          'https://api.etherscan.io/api?module=stats&action=ethprice&apikey=53YRRR2ZWJ1D14S2AU85A8M3IJXX9EKH48'
        );
        const ethPrice = response.amount;
        setEthprice(ethPrice);
        
      }
  
      getBlockNumber();
    });
    

  return (
    <div style={myStyle}>
    <Navbar expand="lg" className="bg-body-tertiary" bg="dark" data-bs-theme="dark">
      <Container fluid>
        <Navbar.Brand href="#">Hexplorer</Navbar.Brand>
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            <Nav.Link href="#action1">Home</Nav.Link>
            <NavDropdown title="Network" id="navbarScrollingDropdown">
              <NavDropdown.Item href="#action3">Ethereum Mainnet</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action5">
                Sepolia Testnet
              </NavDropdown.Item>
              <NavDropdown.Item href="#action5">
                Goerli Testnet
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success">Search</Button>
          </Form>
      </Container>
    </Navbar>
    <Card style={{ height: '6rem',border: 'none', background: 'transparent'}}></Card>
    <Container>
        <Row>
        <Card border="dark" style={{ width: '25rem',backgroundColor: 'black',color:'white',opacity: 0.7 }}>
          <Container>
            <Row>
              <Col>
                  <img src="/logo1.png" width="40" height="60"/>
              </Col>
              <Col>
                <Card.Body>
                <Card.Title>Ether Price</Card.Title>
                <Card.Text>
                        {ethPrice}
                </Card.Text>
                </Card.Body>
              </Col>
            </Row>
          </Container>
              </Card>
        </Row>
    <Card style={{ height: '8rem', border: 'none', background: 'transparent'}}></Card>
        <Row>
        <Col>
            <Card border="dark" style={{ width: '40rem' }}>
            <Card.Header>Header</Card.Header>
            <Card.Body>
            <Card.Title>Dark Card Title</Card.Title>
            <Card.Text>
                Some quick example text to build on the card title and make up the
                bulk of the card's content.
            </Card.Text>
            </Card.Body>
            </Card>
        </Col>
            <Col>
                <Card border="dark" style={{ width: '38rem' }}>
                <Card.Header>Header</Card.Header>
                <Card.Body>
                <Card.Title>Dark Card Title</Card.Title>
                <Card.Text>
                    Some quick example text to build on the card title and make up the
                    bulk of the card's content.
                </Card.Text>
                </Card.Body>
                </Card>
        </Col>
      </Row>
      </Container>

    </div>
  );
  } 


export default Navigation;
